import React from 'react';
import { connect } from 'react-redux';
import createTodoContainer from '../containers/createTodo.container';
import 'bootstrap/dist/css/bootstrap.min.css';


const CreateTodo = ({submit}) => {
    return (
        <div className='container'>
            <h3 style={{marginBottom: 20,}}>Create Todo</h3>
            <div className='row'>
                <form onSubmit={submit}>
                    <div className='form-group'>
                        <label for='description'>Description:</label>
                        <input type='text' placeholder='Input description' className='form-control' id='description' />
                    </div>
                    <div className='form-group'>
                        <label for='responsible'>Responsible:</label>
                        <input type='text' placeholder='Input responsible' className='form-control' id='responsible' />
                    </div>
                    <div className='form-group'>
                        <label for='priority'>Priority:</label>
                        <input type='text' placeholder='Input priority' className='form-control' id='priority' />
                    </div>
                </form>
            </div>
        </div>
    )
}
export default connect(null, createTodoContainer.mapDispatchToProps)(CreateTodo);
